// Objetivo: Converter telefone para o formato +5511xxxxxxxxx (SÃ£o Paulo)
// Fonte principal: json.body.data.key.remoteJid (ex.: "5511942537015@s.whatsapp.net")

return items.map((item) => {
  const pick = (...paths) => {
    for (const p of paths) {
      try {
        const v = p.split('.').reduce((acc, k) => (acc ? acc[k] : undefined), item.json);
        if (typeof v === 'string' && v.trim()) return v;
      } catch (e) {}
    }
    return '';
  };

  // 1) Tenta achar o telefone nas fontes mais comuns
  const raw =
    pick('body.data.key.remoteJid',
         'data.key.remoteJid',
         'remoteJid',
         'body.phone',
         'phone') || '';

  // 2) Extrai somente dÃ­gitos
  const digits = (raw.match(/\d+/g) || []).join('');

  // 3) Remove 55 e 11 iniciais, se jÃ¡ vierem presentes
  let local = digits;
  if (local.startsWith('55')) local = local.slice(2);
  if (local.startsWith('11')) local = local.slice(2);

  // 4) MantÃ©m apenas os ÃšLTIMOS 9 dÃ­gitos (padrÃ£o celular SP). 
  //    Se vier 8 dÃ­gitos (fixo antigo), mantÃ©m 8.
  if (local.length >= 9) {
    local = local.slice(-9);
  } else if (local.length === 0) {
    // Se nÃ£o achou nada Ãºtil, deixa avisado
    local = '';
  }

  const phone_formatted = local ? `+5511${local}` : '';

  return {
    json: {
      ...item.json,
      phone_raw: raw,           // Ex.: "5511942537015@s.whatsapp.net"
      phone_digits: digits,     // Ex.: "5511942537015"
      phone_formatted,          // Ex.: "+5511942537015"
